import React from 'react';
import ReactDOM from 'react-dom';

function MyInfo(){
    return(
        <div>
            <h1>Maryam</h1>
            <p>I am beautiful!</p>
            <ul>
                <li>Japan</li>
                <li>Florida</li>
                <li>Bali</li>
            </ul>
         </div>
    )
}
ReactDOM.render(
    <MyInfo />,
    document.getElementById("root")
  )
